import React from 'react';
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css';


// {props.name || props.title ? <h2>{props.name || props.title}</h2> :<h2>{props.teamOne} vs {props.teamTwo} {props.type}</h2>}
// { props.title ? <h3>{props.description} </h3>:<h3>Toss : {props.toss}</h3>}
//     <h6>{props.date}</h6>
//     <button 
//     disabled={props.name ? true : false}
//     className="btn btn-primary" 
//     onClick={props.clicked}>match details</button>

const match = (props) => {
    return (
        <div className="container">
            <div className="row" >
                <div className="col-xs-1 col-sm-2 col-md-2 col-lg-2" ></div>
                <div className="col-xs-8 col-sm-8 col-md-8 col-lg-8" style={{ marginTop: 20 }}>
                    {props.name || props.title ? <h4>{props.name || props.title}</h4> : <h4>{props.teamOne} vs {props.teamTwo} {props.type}</h4>}
                    <p>{props.teamOne}</p>
                    <p>{props.teamTwo}</p>
                    <p>{props.date}</p>
                    <button className="btn btn-primary btn-md"
                        disabled={props.name ? true : false}
                        onClick={props.clicked}>Search</button>
                </div>
                <div className="col-xs-1 col-sm-2 col-md-2 col-lg-2" ></div>
            </div>
        </div>
    );
}

export default match;
